import React from "react";
import { Svg, Rect, Defs, Pattern, Image } from "react-native-svg";

const SvgComponent = (props) => (
  <Svg
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    width={316}  // Updated width to accommodate two images in a row
    height={158}
    fill="none"
    {...props}
  >
    {/* First Photo */}
    <Rect width={158} height={158} fill="url(#a)" rx={19} />
    <Defs>
      <Pattern
        id="a"
        width={1}
        height={1}
        patternContentUnits="objectBoundingBox"
      >
        {/* Here, you can replace 'YOUR_BASE64_IMAGE_DATA' with your actual base64 image data */}
        <Image
          href={`data:image/jpeg;base64,`}
          width={1}
          height={1}
        />
      </Pattern>
    </Defs>

    {/* Second Photo */}
    <Rect x={158} width={158} height={158} fill="url(#b)" rx={19} />
    <Defs>
      <Pattern
        id="b"
        width={1}
        height={1}
        patternContentUnits="objectBoundingBox"
      >
        {/* Here, you can replace 'YOUR_BASE64_IMAGE_DATA_2' with your actual base64 image data */}
        <Image
          href={`data:image/jpeg;base64,`}  
          width={1}
          height={1}
        />
      </Pattern>
    </Defs>
  </Svg>
);

export default SvgComponent;















































